function initMap(){var e=new google.maps.Map(document.getElementById("map"),{zoom:2,center:{lat:26.2639368,lng:12.7765974},scrollwheel:!1}),t=locationCoords.map(function(e){return new google.maps.Marker({position:e})});new MarkerClusterer(e,t,{imagePath:"https://developers.google.com/maps/documentation/javascript/examples/markerclusterer/m"})}var google,locationCoords=[];$.ajax({url:"locations.json",dataType:"text",success:function(e){var t=$.parseJSON(e);$.ajax({url:"/portfolio/traveltracker/data/countries.json",dataType:"text",success:function(e){for(var o=$.parseJSON(e),a=0;a<t.length;a++){var r="<li>"+t[a]+"</li>";document.getElementById("visitedList").innerHTML+=r,document.getElementById("congrats").innerHTML="<p>Congrats! You have visited "+t.length+" countries/territories.</p><p>"+Math.round(t.length/247*100)+"% of 247 countries/territories around the globe.</p>";for(var n=0;n<o.length;n++)if(t[a]===o[n].name){var l={lat:parseFloat(o[n].latlng[0]),lng:parseFloat(o[n].latlng[1])};locationCoords.push(l)}initMap()}}})}});